import React from 'react';
import {Component} from 'react';
import './App.css';

function Item(props){
  return(
  <li>{props.value}</li>
  )
}

class App extends Component {
  renderListitem(itemText){
    return <Item value={itemText} />
  }

  render(){
    return (
      <div className="App">
        <h1>to-do list</h1>
        <ul>
        </ul>
      </div>
    );
  }
}

export default App;
